{
  "openapi": "3.0.2",
  "servers": [
    {
      "description": "Vimeo.com",
      "url": "https://api.vimeo.com"
    }
  ],
  "info": {
    "contact": {
      "url": "https://developer.vimeo.com/help",
      "x-twitter": "vimeo"
    },
    "title": "Vimeo",
    "version": "3.4",
    "x-apisguru-categories": [
      "entertainment"
    ],
    "x-logo": {
      "url": "https://api.apis.guru/v2/cache/logo/https_twitter.com_vimeo_profile_image.jpeg"
    },
    "x-origin": [
      {
        "converter": {
          "url": "https://github.com/lucybot/api-spec-converter",
          "version": "2.7.31"
        },
        "format": "openapi",
        "url": "https://raw.githubusercontent.com/vimeo/openapi/master/api.yaml",
        "version": "3.0"
      }
    ],
    "x-preferred": true,
    "x-providerName": "vimeo.com"
  },
  "security": [
    {
      "oauth2": [
        "create",
        "delete",
        "edit",
        "email",
        "interact",
        "private",
        "promo_codes",
        "public",
        "purchase",
        "purchased",
        "stats",
        "upload",
        "video_files"
      ]
    }
  ],
  "tags": [
    {
      "name": "Albums\\Essentials"
    },
    {
      "name": "Albums\\Album videos"
    },
    {
      "name": "Videos\\Comments"
    },
    {
      "name": "Videos\\Essentials"
    }
  ],
  "paths": {
    "/users/{user_id}/albums/{album_id}": {
        "delete": {
          "operationId": "delete_album",
          "parameters": [
            {
              "description": "The ID of the album.",
              "in": "path",
              "name": "album_id",
              "required": true,
              "schema": {
                "example": 3706071,
                "type": "number"
              }
            },
            {
              "description": "The ID of the user.",
              "in": "path",
              "name": "user_id",
              "required": true,
              "schema": {
                "example": 152184,
                "type": "number"
              }
            }
          ],
          "responses": {
            "204": {
              "description": "The album was deleted."
            },
            "403": {
              "content": {
                "application/json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "The supplied token doesn't have the proper scopes, or the authenticated user can't delete the album."
            },
            "404": {
              "content": {
                "application/json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "No such album exists."
            }
          },
          "security": [
            {
              "oauth2": [
                "delete"
              ]
            }
          ],
          "summary": "Delete an album",
          "tags": [
            "Albums\\Essentials"
          ]
        },
        "get": {
          "operationId": "get_album",
          "parameters": [
            {
              "description": "The ID of the album.",
              "in": "path",
              "name": "album_id",
              "required": true,
              "schema": {
                "example": 3706071,
                "type": "number"
              }
            },
            {
              "description": "The ID of the user.",
              "in": "path",
              "name": "user_id",
              "required": true,
              "schema": {
                "example": 152184,
                "type": "number"
              }
            }
          ],
          "responses": {
            "200": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/album"
                  }
                }
              },
              "description": "The album was returned."
            },
            "404": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "No such album exists."
            }
          },
          "summary": "Get a specific album",
          "tags": [
            "Albums\\Essentials"
          ]
        },
        "patch": {
          "operationId": "edit_album",
          "parameters": [
            {
              "description": "The ID of the album.",
              "in": "path",
              "name": "album_id",
              "required": true,
              "schema": {
                "example": 3706071,
                "type": "number"
              }
            },
            {
              "description": "The ID of the user.",
              "in": "path",
              "name": "user_id",
              "required": true,
              "schema": {
                "example": 152184,
                "type": "number"
              }
            }
          ],
          "requestBody": {
            "content": {
              "application/vnd.vimeo.album+json": {
                "schema": {
                  "properties": {
                    "brand_color": {
                      "description": "The hexadecimal code for the color of the player buttons.",
                      "example": "ff66ee",
                      "type": "string"
                    },
                    "description": {
                      "description": "The description of the album.",
                      "example": "Vimeo holiday videos!",
                      "type": "string"
                    },
                    "domain": {
                      "description": "The custom domain a user has selected for their album.",
                      "example": "mycustomdomain.com",
                      "nullable": true,
                      "type": "string"
                    },
                    "hide_nav": {
                      "description": "Whether to hide Vimeo navigation when displaying the album.",
                      "example": "true",
                      "type": "boolean"
                    },
                    "layout": {
                      "description": "The type of layout for presenting the album.",
                      "enum": [
                        "grid",
                        "player"
                      ],
                      "type": "string"
                    },
                    "name": {
                      "description": "The name of the album.",
                      "example": "Vimeo Holiday Videos!",
                      "type": "string"
                    },
                    "password": {
                      "description": "The album's password. Required only if **privacy** is `password`.",
                      "example": "hunter1",
                      "type": "string"
                    },
                    "privacy": {
                      "description": "The privacy level of the album.",
                      "enum": [
                        "anybody",
                        "embed_only",
                        "password"
                      ],
                      "type": "string"
                    },
                    "review_mode": {
                      "description": "Whether album videos should use the review mode URL.",
                      "example": "true",
                      "type": "boolean"
                    },
                    "sort": {
                      "description": "The default sort order of the album's videos.",
                      "enum": [
                        "added_first",
                        "added_last",
                        "alphabetical",
                        "arranged",
                        "comments",
                        "likes",
                        "newest",
                        "oldest",
                        "plays"
                      ],
                      "type": "string"
                    },
                    "theme": {
                      "description": "The color theme of the album.",
                      "enum": [
                        "dark",
                        "standard"
                      ],
                      "type": "string"
                    },
                    "url": {
                      "description": "The custom Vimeo URL a user has selected for their album.",
                      "example": "my-custom-url",
                      "nullable": true,
                      "type": "string"
                    },
                    "use_custom_domain": {
                      "description": "Whether the user has opted in to use a custom domain for their album.",
                      "example": "true",
                      "type": "boolean"
                    }
                  },
                  "type": "object"
                }
              }
            },
            "required": false
          },
          "responses": {
            "200": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/album"
                  }
                }
              },
              "description": "The album was edited."
            },
            "400": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "A parameter is invalid."
            },
            "403": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "The authenticated user doesn't own the album, the supplied token doesn't have the proper scopes, or the authenticated user can't edit the album."
            },
            "404": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "No such album exists."
            }
          },
          "security": [
            {
              "oauth2": [
                "edit"
              ]
            }
          ],
          "summary": "Edit an album",
          "tags": [
            "Albums\\Essentials"
          ]
        }
      },
      "/users/{user_id}/albums": {
        "post": {
          "operationId": "create_album",
          "parameters": [
            {
              "description": "The ID of the user.",
              "in": "path",
              "name": "user_id",
              "required": true,
              "schema": {
                "example": 152184,
                "type": "number"
              }
            }
          ],
          "requestBody": {
            "content": {
              "application/vnd.vimeo.album+json": {
                "schema": {
                  "properties": {
                    "brand_color": {
                      "description": "The hexadecimal code for the color of the player buttons.",
                      "example": "ff66ee",
                      "type": "string"
                    },
                    "description": {
                      "description": "The description of the album.",
                      "example": "Vimeo holiday videos!",
                      "type": "string"
                    },
                    "hide_nav": {
                      "description": "Whether to hide Vimeo navigation when displaying the album.",
                      "example": "true",
                      "type": "boolean"
                    },
                    "layout": {
                      "description": "The type of layout for presenting the album.",
                      "enum": [
                        "grid",
                        "player"
                      ],
                      "type": "string"
                    },
                    "name": {
                      "description": "The name of the album.",
                      "example": "Vimeo Holiday Videos!",
                      "type": "string"
                    },
                    "password": {
                      "description": "The album's password. Required only if **privacy** is `password`.",
                      "example": "hunter1",
                      "type": "string"
                    },
                    "privacy": {
                      "description": "The privacy level of the album.",
                      "enum": [
                        "anybody",
                        "embed_only",
                        "password"
                      ],
                      "type": "string"
                    },
                    "review_mode": {
                      "description": "Whether album videos should use the review mode URL.",
                      "example": "true",
                      "type": "boolean"
                    },
                    "sort": {
                      "description": "The default sort order of the album's videos.",
                      "enum": [
                        "added_first",
                        "added_last",
                        "alphabetical",
                        "arranged",
                        "comments",
                        "likes",
                        "newest",
                        "oldest",
                        "plays"
                      ],
                      "type": "string"
                    },
                    "theme": {
                      "description": "The color theme of the album.",
                      "enum": [
                        "dark",
                        "standard"
                      ],
                      "type": "string"
                    }
                  },
                  "required": [
                    "name"
                  ],
                  "type": "object"
                }
              }
            },
            "required": true
          },
          "responses": {
            "201": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/album"
                  }
                }
              },
              "description": "The album was created."
            },
            "400": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "A parameter is invalid."
            },
            "403": {
              "content": {
                "application/vnd.vimeo.album+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "The supplied token doesn't have the proper scopes, or the authenticated user can't create an album."
            }
          },
          "security": [
            {
              "oauth2": [
                "create"
              ]
            }
          ],
          "summary": "Create an album",
          "tags": [
            "Albums\\Essentials"
          ]
        }
      },
      "/users/{user_id}/albums/{album_id}/videos": {
        "get": {
          "operationId": "get_album_videos",
          "parameters": [
            {
              "description": "The ID of the album.",
              "in": "path",
              "name": "album_id",
              "required": true,
              "schema": {
                "example": 3706071,
                "type": "number"
              }
            },
            {
              "description": "The ID of the user.",
              "in": "path",
              "name": "user_id",
              "required": true,
              "schema": {
                "example": 152184,
                "type": "number"
              }
            },
            {
              "description": "The page containing the video URI.",
              "in": "query",
              "name": "containing_uri",
              "required": false,
              "schema": {
                "example": "/videos/258684937",
                "type": "string"
              }
            },
            {
              "description": "The sort direction of the results.",
              "in": "query",
              "name": "direction",
              "required": false,
              "schema": {
                "enum": [
                  "asc",
                  "desc"
                ],
                "example": "asc",
                "type": "string"
              }
            },
            {
              "description": "The attribute by which to filter the results.",
              "in": "query",
              "name": "filter",
              "required": false,
              "schema": {
                "enum": [
                  "embeddable"
                ],
                "type": "string"
              }
            },
            {
              "description": "Whether to filter the results by embeddable videos (`true`) or non-embeddable videos (`false`). Required only if **filter** is `embeddable`.",
              "in": "query",
              "name": "filter_embeddable",
              "required": false,
              "schema": {
                "example": "true",
                "type": "boolean"
              }
            },
            {
              "description": "The page number of the results to show.",
              "in": "query",
              "name": "page",
              "required": false,
              "schema": {
                "example": 1,
                "type": "number"
              }
            },
            {
              "description": "The password of the album.",
              "in": "query",
              "name": "password",
              "required": false,
              "schema": {
                "example": "hunter1",
                "type": "string"
              }
            },
            {
              "description": "The number of items to show on each page of results, up to a maximum of 100.",
              "in": "query",
              "name": "per_page",
              "required": false,
              "schema": {
                "example": 10,
                "type": "number"
              }
            },
            {
              "description": "The search query to use to filter the results.",
              "in": "query",
              "name": "query",
              "required": false,
              "schema": {
                "example": "Stop motion",
                "type": "string"
              }
            },
            {
              "description": "The way to sort the results.",
              "in": "query",
              "name": "sort",
              "required": false,
              "schema": {
                "enum": [
                  "alphabetical",
                  "comments",
                  "date",
                  "default",
                  "duration",
                  "likes",
                  "manual",
                  "modified_time",
                  "plays"
                ],
                "type": "string"
              }
            },
            {
              "description": "Whether to include private videos in the search. Please note that a separate search service provides this functionality. The service performs a partial text search on the video's name.",
              "in": "query",
              "name": "weak_search",
              "required": false,
              "schema": {
                "example": "false",
                "type": "boolean"
              }
            }
          ],
          "responses": {
            "200": {
              "content": {
                "application/vnd.vimeo.video+json": {
                  "schema": {
                    "items": {
                      "$ref": "#/components/schemas/video"
                    },
                    "type": "array"
                  }
                }
              },
              "description": "The videos were returned."
            },
            "404": {
              "content": {
                "application/vnd.vimeo.video+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "No such album exists."
            }
          },
          "summary": "Get all the videos in an album",
          "tags": [
            "Albums\\Album videos"
          ]
        }
      },
      "/videos/{video_id}/comments": {
        "get": {
          "operationId": "get_comments",
          "parameters": [
            {
              "description": "The ID of the video.",
              "in": "path",
              "name": "video_id",
              "required": true,
              "schema": {
                "example": 258684937,
                "type": "number"
              }
            },
            {
              "description": "The sort direction of the results.",
              "in": "query",
              "name": "direction",
              "required": false,
              "schema": {
                "enum": [
                  "asc",
                  "desc"
                ],
                "example": "asc",
                "type": "string"
              }
            },
            {
              "description": "The page number of the results to show.",
              "in": "query",
              "name": "page",
              "required": false,
              "schema": {
                "example": 1,
                "type": "number"
              }
            },
            {
              "description": "The number of items to show on each page of results, up to a maximum of 100.",
              "in": "query",
              "name": "per_page",
              "required": false,
              "schema": {
                "example": 10,
                "type": "number"
              }
            }
          ],
          "responses": {
            "200": {
              "content": {
                "application/vnd.vimeo.comment+json": {
                  "schema": {
                    "items": {
                      "$ref": "#/components/schemas/comment"
                    },
                    "type": "array"
                  }
                }
              },
              "description": "The comments were returned."
            }
          },
          "summary": "Get all the comments on a video",
          "tags": [
            "Videos\\Comments"
          ]
        }
      },
      "/videos": {
        "get": {
          "operationId": "search_videos",
          "parameters": [
            {
              "description": "The sort direction of the results.",
              "in": "query",
              "name": "direction",
              "required": false,
              "schema": {
                "enum": [
                  "asc",
                  "desc"
                ],
                "example": "asc",
                "type": "string"
              }
            },
            {
              "description": "The attribute by which to filter the results. `CC` and related filters target videos with the corresponding Creative Commons licenses. For more information, see our [Creative Commons](https://vimeo.com/creativecommons) page.",
              "in": "query",
              "name": "filter",
              "required": false,
              "schema": {
                "enum": [
                  "CC",
                  "CC-BY",
                  "CC-BY-NC",
                  "CC-BY-NC-ND",
                  "CC-BY-NC-SA",
                  "CC-BY-ND",
                  "CC-BY-SA",
                  "CC0",
                  "categories",
                  "duration",
                  "in-progress",
                  "minimum_likes",
                  "trending",
                  "upload_date"
                ],
                "type": "string"
              }
            },
            {
              "description": "A comma-separated list of video URLs to find.",
              "in": "query",
              "name": "links",
              "required": false,
              "schema": {
                "example": "https://vimeo.com/122375452,https://vimeo.com/273576296",
                "type": "string"
              }
            },
            {
              "description": "The page number of the results to show.",
              "in": "query",
              "name": "page",
              "required": false,
              "schema": {
                "example": 1,
                "type": "number"
              }
            },
            {
              "description": "The number of items to show on each page of results, up to a maximum of 100.",
              "in": "query",
              "name": "per_page",
              "required": false,
              "schema": {
                "example": 10,
                "type": "number"
              }
            },
            {
              "description": "Search query.",
              "in": "query",
              "name": "query",
              "required": true,
              "schema": {
                "example": "staff picks",
                "type": "string"
              }
            },
            {
              "description": "The way to sort the results.",
              "in": "query",
              "name": "sort",
              "required": false,
              "schema": {
                "enum": [
                  "alphabetical",
                  "comments",
                  "date",
                  "duration",
                  "likes",
                  "plays",
                  "relevant"
                ],
                "type": "string"
              }
            },
            {
              "description": "The comma-separated list of videos to find.",
              "in": "query",
              "name": "uris",
              "required": false,
              "schema": {
                "example": "/videos/122375452,/videos/273576296",
                "type": "string"
              }
            }
          ],
          "responses": {
            "200": {
              "content": {
                "application/vnd.vimeo.video+json": {
                  "schema": {
                    "items": {
                      "$ref": "#/components/schemas/video"
                    },
                    "type": "array"
                  }
                }
              },
              "description": "The search results were returned."
            },
            "400": {
              "content": {
                "application/vnd.vimeo.video+json": {
                  "schema": {
                    "$ref": "#/components/schemas/error"
                  }
                }
              },
              "description": "* Error code 2101: Either the `uris` or `links` parameter has filtering or sorting arguments.\n* Error code 2204: There is a problem with the batch request."
            },
            "503": {
              "content": {
                "application/vnd.vimeo.video+json": {
                  "schema": {
                    "$ref": "#/components/schemas/legacy-error"
                  }
                }
              },
              "description": "* Search is disabled.\n* Error code 7300: There was an internal search error."
            }
          },
          "summary": "Search for videos",
          "tags": [
            "Videos\\Essentials"
          ]
        }
      }
  }
}
